import React, {lazy, Suspense} from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import MainMenu from "./App";
import reportWebVitals from "./reportWebVitals";
import { Routes, Route, Navigate, BrowserRouter } from "react-router-dom";
import Homework11 from "./homework-1.1/task1.js";
import Homework12 from "./homework-1.2/task2.js";
import Homework13 from "./homework-1.3/task3.js";
import Homework14 from "./homework-1.4/task4";
import Homework21 from "./homework-2.1/task";
import Homework22 from "./homework-2.2/phonebook";
// import Homework32 from "./homework-3.2/images";
import Homework4 from "./homework-4/William";

const Homework32 = lazy(() => import("./homework-3.2/images"));

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <>
    <BrowserRouter>
      <Routes>
        <Suspense fallback={<div>Loading...</div>}>
          <Route exact path="/" element={<MainMenu />}/>
          <Route path="homework-1.1" element={<Homework11 />} />
          <Route path="homework-1.2" element={<Homework12 />} />
          <Route path="homework-1.3" element={<Homework13 />} />
          <Route path="homework-1.4" element={<Homework14 />} />
          <Route path="homework-2.1" element={<Homework21 />} />
          <Route path="homework-2.2" element={<Homework22 />} />
          <Route path="homework-3.2" element={<Homework32 />} />
          <Route path="homework-4/*" element={<Homework4 />} />
          <Route path="homework-6" element={<MainMenu />} />
          <Route path="homework-7" element={<MainMenu />} />
          <Route path="homework-8" element={<MainMenu />} />
          {/* <Route path="*" element={<Navigate to="/" replace />} /> */}
        </Suspense>
      </Routes>
    </BrowserRouter>
  </>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
